window.bookSummaryJSON = "<p><b>The devastatingly wicked princes don't just want my powers…</b></p> <p>They want my mind, body, and soul.</p> <p>After a brutal attack on Gaia's temple, I find myself turning to an unlikely ally for help. Only he can save me from this new threat.</p> <p>But past and present collide when I reunite with the very princes I once feared. They no longer want to cage me away.</p> <p>No, these villains are determined to see me soar… and they'll kill anyone who gets in their way.</p> <p>Survival won't be easy when we discover we have to travel through a forest full of unspeakable horrors and face threats we never knew existed.</p> <p>The clock is ticking, and every moment that passes brings us one step closer to the end of all we know.</p> <p>Death has whispered to me for years now, and I've finally learned how to listen.</p> <p><i>Of Wind and Terror </i>is the third book of a reverse harem series (but not the last book).The story will end with a cliffhanger.</p> <p><b>Be warned—in this book, you'll find psychotic villains obsessed with their girl, an extravagant world, and a surplus of plot and character development. The series will get steamier as it progresses.</b></p>"; 
